import React from "react";
import styled from "styled-components";

import Share from "@mui/icons-material/ReplyOutlined";
import Save from "@mui/icons-material/SaveAltOutlined";
import ThumbsDown from "@mui/icons-material/ThumbDownOutlined";
import ThumbsUp from "@mui/icons-material/ThumbUpOutlined";

const Container = styled.div`
  display: flex;
  gap: 24px;
`;

const Content = styled.div`
  flex: 5;
`;

const VideoWrapper = styled.div``;

const Title = styled.h1`
  font-size: 18px;
  font-weight: 400;
  margin-top: 20px;
  margin-bottom: 10px;

  color: ${({ theme }) => theme.text};
`;

const Details = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
`;

const Info = styled.span`
  color: ${({ theme }) => theme.textSoft};
`;

const Buttons = styled.div`
  display: flex;
  gap: 20px;
  color: ${({ theme }) => theme.text};
`;

const Button = styled.div`
  display: flex;
  align-items: center;
  gap: 5px;
  cursor: pointer;
`;

const Hr = styled.hr`
  margin: 15px 0px;
  border: 0.5px solid ${({ theme }) => theme.textSoft};
`;

const Recommendation = styled.div`
  flex: 2;
`;

function Video() {
  return (
    <Container>
      <Content>
        <VideoWrapper>
          <iframe
            width="100%"
            height="720"
            src="https://www.youtube.com/embed/tgbNymZ7vqY"
            title="YouTube video player"
            frameborder="0"
            allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
            allowfullscreen
          ></iframe>
        </VideoWrapper>
        <Title> Test Video</Title>
        <Details>
          <Info>128,147,898 views â€¢ Feb 22, 2022</Info>
          <Buttons>
            <Button>
              <ThumbsUp /> 444
            </Button>
            <Button>
              <ThumbsDown /> Dislike
            </Button>
            <Button>
              <Share /> Dislike
            </Button>
            <Button>
              <Save /> Save
            </Button>
          </Buttons>
        </Details>
        <Hr />
      </Content>
      <Recommendation>Recommendation</Recommendation>
    </Container>
  );
}

export default Video;
